import './App.css';

function App() {
  return (
    <div className='bg-slate-200 w-full h-[100vh] flex items-center justify-center'>
        <div className='h-[80%] w-[40%] bg-white p-8 drop-shadow-md rounded-lg flex flex-col items-center gap-12  '>
            <h1 className='text-[32px] font-semibold text-sky-900'>Bank Mangement</h1>
            <form className='text-sky-900 font-medium text-[20px] px-24 w-full flex flex-col items-start gap-6'>
                <div className='flex flex-col gap-1 w-full'>
                <label  for='rib'>RIB</label>
                <input id='rib' className='ring-1 ring-sky-800 rounded-sm outline-none px-2 py-1 text-[16px] text-sky-900'></input>
                </div>

            </form>
        </div>

    </div>
  )
}

export default App;
